import { Link } from 'react-router-dom';
import './stylesheets/table_of_contents.css'
import Dropdown from './dropdown';
import { overviewItems, discoverItems } from './menuItems';

export function Table_of_contents() { 
  return (
    <div className="hero_Table_of_contents">
        <ul className="toc-menu">
        <li>
            <Dropdown title="Overview" items={overviewItems} />

          </li>
          <li>
            <Dropdown title="Discover" items={overviewItems} />

          </li>
          <li>
            <Dropdown title="Discern" items={overviewItems} />
            <Link to="/Dicern">Discern</Link>
          </li>
          <li>
            <Dropdown title="Develop" items={overviewItems} />
          </li>
          <li>
            <Dropdown title="Demonstrate" items={overviewItems} />

          </li>
        </ul>
    </div>
  );
}
export default Table_of_contents;
